    def generate_state_identifier(self, game_state):
        grid_data = tuple(tuple(tuple(map(tuple, sector)) for sector in row) for row in game_state.board)
        active_sector = None
        last_move = game_state.prev_local_action

        if last_move:
            sector_row, sector_col = last_move
            if game_state.local_board_status[sector_row][sector_col] == 0:
                active_sector = last_move

        status_data = tuple(map(tuple, game_state.local_board_status))
        return (grid_data, game_state.fill_num, active_sector, status_data)

    def choose_action(self, game_state):
        #game_state = game_state.invert()
        #dictt = {}
        start_time = time.time()
        possible_moves = game_state.get_all_valid_actions()
        search_depth = 1
        optimal_move = possible_moves[0] if possible_moves else None
        self.position_cache = {}

        try:
            while time.time() - start_time < TIME_LIMIT:
                current_best = game_state.get_random_valid_action()
                max_value = -float('inf')
                alpha = -float('inf')
                beta = float('inf')
                #print(dictt)
                for move in possible_moves:
                    if time.time() - start_time >= TIME_LIMIT:
                        raise TimeoutError

                    simulated_state = game_state.clone()
                    updated_state = simulated_state.change_state(move, check_valid_action=True)

                    move_score = self.minimax(
                        updated_state,
                        search_depth - 1,
                        alpha,
                        beta,
                        False,
                        start_time,
                        self.position_cache
                    )
                    #print(move_score)
                    #dictt[move] = move_score
                    if move_score > max_value:
                        max_value = move_score
                        current_best = move

                    alpha = max(alpha, max_value)

                optimal_move = current_best
                current_best = game_state.get_random_valid_action()
                max_value = -100
                search_depth += 1

        except TimeoutError:
            #print(search_depth)
            pass

        #print("agent9: " + str(search_depth))
        #global counter
        #print(counter)
        #counter = 0
        #print(dictt)
        #print(optimal_move)
        return optimal_move

    def minimax(self, game_state, depth, alpha, beta, is_maximizing, start_time, position_cache):
        if time.time() - start_time >= TIME_LIMIT:
            raise TimeoutError

        state_id = self.generate_state_identifier(game_state)
        if state_id in position_cache:
            cached_depth, cached_score = position_cache[state_id]
            if cached_depth >= depth:
                return cached_score

        terminal_check = game_state.is_terminal()
        if terminal_check or depth <= 0:
            evaluation = self.evaluate_board(game_state)
            store_depth = float('inf') if terminal_check else depth
            if state_id not in position_cache or position_cache[state_id][0] < store_depth:
                position_cache[state_id] = (store_depth, evaluation)
            return evaluation
        #global counter
        legal_moves = game_state.get_all_valid_actions()
        if not legal_moves:
            score = self.evaluate_board(game_state)
            #counter -= 1
            if state_id not in position_cache or position_cache[state_id][0] < depth:
                position_cache[state_id] = (depth, score)
            return score

        move_priorities = []
        for action in legal_moves:
            temp_state = game_state.clone().change_state(action)
            priority_score = lightweight_evaluate_board(temp_state)
            #counter -= 1
            move_priorities.append((priority_score, action))

        move_priorities.sort(reverse=is_maximizing, key=lambda x: x[0])
        sorted_moves = [m for _, m in move_priorities]
        if is_maximizing:
            best_score = -float('inf')
            for move in sorted_moves:
                new_state = game_state.change_state(move, check_valid_action=True)
                current_score = self.minimax(
                    new_state, depth-1, alpha, beta,
                    False, start_time, position_cache
                )
                best_score = max(best_score, current_score)
                alpha = max(alpha, best_score)
                if beta <= alpha:
                    break
            result = best_score
        else:
            worst_score = float('inf')
            for move in sorted_moves:
                new_state = game_state.change_state(move, check_valid_action=True)
                current_score = self.minimax(
                    new_state, depth-1, alpha, beta,
                    True, start_time, position_cache
                )
                worst_score = min(worst_score, current_score)
                beta = min(beta, worst_score)
                if beta <= alpha:
                    break
            result = worst_score

        if state_id not in position_cache or position_cache[state_id][0] < depth:
            position_cache[state_id] = (depth, result)

        return result

    def evaluate_board(self, state) -> float:
        #global counter
        #counter += 1
        if state.is_terminal():
            utility = state.terminal_utility()
            return 1 if utility == 1 else (0 if utility == 0.5 else -1)

        x = np.asarray(get_feature_values(state), dtype=np.float32)
        x = (x - self.X_mean) / self.X_std

        # Fused feedforward NN
        x = np.dot(self.fc1_weight, x) + self.fc1_bias
        np.maximum(x, 0, out=x)

        x = np.dot(self.fc2_weight, x) + self.fc2_bias
        np.maximum(x, 0, out=x)

        x = np.dot(self.fc3_weight, x) + self.fc3_bias
        return np.tanh(x).item()


